(1, 'Dr.', 'validated', 'Docteur en cardiologue renommé, diplômé de l\'Université de Paris, spécialise dans les maladies cardiovasculaires. Avec 6 ans d\'expérience, j\'ai contribué à des recherches pionnières sur l\'hypertension artérielle. Passionné par l\'enseignement, je partage mon savoir avec les futurs médecins et je reste dévoué à mes patients, en leur offrant des soins de qualité et une attention personnalisée.\n', 150.00, 6, 2, '2024-03-08 15:17:29', '2024-04-17 16:30:18'),
