(3, 'Dr.', 'validated', 'Doloribus maiores veritatis a fugit consequatur. Quam qui quidem iste quia. Similique fugiat eos illo distinctio fugit quasi ut rerum.', 150.00, 3, 4, '2024-03-08 15:17:29', '2024-04-04 11:09:23'),
(4, 'Dr.', 'validated', 'Facere optio beatae eum iusto aut. Velit ducimus optio incidunt. Vel sapiente consectetur autem cupiditate officiis maxime quia et. Occaecati accusamus repellat doloribus tempore.', 150.00, 1, 5, '2024-03-08 15:17:29', '2024-04-02 14:53:31'),
(5, 'Dr.', 'notvalidated', 'Et debitis exercitationem aspernatur ut qui ipsa asperiores quia. Maiores facere voluptas repellendus harum. Beatae corporis in expedita saepe. Eius dignissimos consequatur excepturi non nihil illo voluptatibus.', 150.00, 1, 6, '2024-03-08 15:17:29', '2024-03-08 15:17:29'),
